sys_hub_input_scripts.script:
{"body":{"scriptActive":true,"script":"
var tx = new GlideRecord("x_snc_hconnector_accountcreate")
tx.get(fd_data.action_inputs.tx)

var key = new GlideRecord("x_snc_hconnector_key")
key.get(tx.key)

var req = {}

if (key.public_key) { req.key = key.getValue(2public_key") } 
if (tx.memo) { req.memo = tx.getValue("memo") } 
if (tx.receiver_signature_required) { req.reqsig = tx.receiver_signature_required }

return req"}}

sys_variable_value.value:
(function execute(inputs, outputs) {

     var tx = inputs.tx
	 var cmdout = inputs.cmdout;

     try {
        tx.output = cmdout;

        output = JSON.parse(cmdout)

        tx.transaction_id = output.resp.transactionId
        tx.transaction_hash = output.resp.transactionHash

        tx.account_id = output.receipt.accountId

        gr = new GlideRecord("x_snc_hconnector_account")
        gr.initialize()
        gr.name = output.receipt.accountId
        gr.account_id = output.receipt.accountId
        gr.insert()

        tx.account = gr.sys_id

        if (output.receipt.status == 'SUCCESS') {
            tx.status = 'completed'
            tx.hedera_status = output.receipt.status
        } else {
            throw Error("Hedera status is not success")
        }	
    } catch (e) {
        tx.out_parsing_log = e.toString()
		tx.hedera_status = output.error.status
        tx.status = 'failed'
    } finally {
        tx.update() 
    }

})(inputs, outputs);

